CREATE TABLE surveys (
  record_id INTEGER, 
  year INTEGER, 
  month INTEGER, 
  day INTEGER, 
  plot_id INTEGER, 
  species_id TEXT, 
  sex TEXT, 
  hindfoot_length INTEGER, 
  weight INTEGER
);

CREATE TABLE species (
  species_id TEXT, 
  genus TEXT, 
  species TEXT, 
  taxa TEXT
);

CREATE TABLE plots (
  plot_id INTEGER, 
  plot_type TEXT
);
